import React from "react";
import InitialSchool from "./components/InitialSchool";
import JuniorSchool from "./components/JuniorSchool";
import HighSchool from "./components/HighSchool";

class GradeListContainer extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      initialSchool: [
        { id: 1, grade: 1 },
        { id: 2, grade: 2 },
        { id: 3, grade: 3 },
        { id: 4, grade: 4 }
      ],
      juniorSchool: [
        { id: 5, grade: 5 },
        { id: 6, grade: 6 },
        { id: 7, grade: 7 }
      ],
      highSchool: [
        { id: 8, grade: 8 },
        { id: 9, grade: 9 },
        { id: 10, grade: 10 },
        { id: 11, grade: 11 },
        { id: 12, grade: 12 }
      ]
    };
  }

  render() {
    return (
      <div className="years_container">
       <InitialSchool/>
       <JuniorSchool/>
       <HighSchool/>
      </div>
    );
  }
}

GradeListContainer.propTypes = {};

export default GradeListContainer;
